import findMovie from '../utils/findMovies.js';

let movies = [
    {
        id: '1',
        logo: 'data:image/jpeg;base64,',
        title: 'Barbie',
        year: 2023
    },
    {
        id: '2',
        logo: 'data:image/jpeg;base64,',
        title: 'Spiderman',
        year: 2002
    },
    {
        id: '3',
        logo: 'data:image/jpeg;base64,',
        title: 'Goblin',
        year: 2021
    },
    {
        id: '4',
        logo: 'data:image/jpeg;base64,',
        title: 'Adela',
        year: 2020
    },
    {
        id: '5',
        logo: 'https://fr.web.img2.acsta.net/pictures/23/04/27/15/59/2127095.jpg',
        title: 'Transformers',
        year: 2024
    }
];

class Movie {
    static getAll = () => {
        return movies;
    };
    static getById = (id) => {
        return findMovie(movies, id);
    };
    static add = (movie) => {
        movies.unshift(movie);
        return movies;
    };
    static update = (id, movie) => {
        const movieExist = findMovie(movies, id);
        if (movieExist) {
            movieExist.title = movie.title;
            movieExist.director = movie.director;
            movieExist.year = movie.year;
            movieExist.logo = movie.logo;
            return movieExist;
        } else {
            return null;
        }
    };
    static remove = (id) => {
        const movieExist = findMovie(movies, id);
        if (movieExist) {
            movies = movies.filter((movie) => movie.id !== id);
            return movies;
        } else {
            return null;
        }
    };
}

export default Movie;
